func TestWKBCodec(t *testing.T) {
	g, err := NewGeometryFromWKT(wkt1)
	assert.NoError(t, err, "")

	bs := g.ToWKB()
	t.Logf("len(wkb) %d", len(bs))
	//	t.Logf("wkb %x", bs)

	g1, err := NewGeometryFromWKB(bs)
	if err != nil {
		t.Error(err)
		return
	}

	w := g1.ToWKT()
	assert.Equal(t, wkt1, w)
}

